项目的根目录 package.json 下，添加 npm postinstall, 以便每次执行 npm install 时能合进所有的patch文件： "scripts": { ...
+ "postinstall": "patch-package" ...
} 安装 patch-package npm i patch-package --save 编辑依赖库 <package-name>, 并执行下面命令生成 patch 文件 npx patch-package <package-name> 再执行以下命令，你就发现最新安装的包已经合进了你刚刚修改的 patch 文件了 npm install

